import trash from "../images/trash.svg";
//import edit from "../images/edit.svg";

const Items = ({ items }) => {
  return (
    <div id="itemWrapper">
      {items.map((item) => {
        return (
          <div className="item" key={item.id}>
            <ul>
              <li>{item.name}</li>
              <li>{item.unit}</li>
              <li>{item.price}</li>
              <li>{item.expiry}</li>
              <li>{item.stocks}</li>
              <li>{item.totalValue}</li>
            </ul>
            <img
              src={trash}
              alt=""
              className="trash"
              id={item.id}
              name={item.name}
              //onClick={handleDelete}
            />
          </div>
        );
      })}
    </div>
  );
};
